Recap of DC. Although, remembering to record while I’m having a great time doesn’t come naturally so I did my best lol 

FOOD PLACES I REALLY ENJOYED:
@steakneggdiner - everything was good but the turkey bacon was 🔥 Open 24/7
@thehamiltondc - late night fresh sushi was SO CLUTCH! 
@kingstreetoyster - really good happy hour spot! Apps and drinks

Shoutout to Kay and Willie for the princess treatment💅🏾 
